import logo from './logo.svg';
import './App.css';
import { Children } from 'react';

const Li = () => {
  return (
    <li className='css-li'>{children}</li>
  );
};

function App() {
  const value = 'test';

  return (
    <ul className='css-ul'>
      <Li>value 1</Li>
    </ul>
  );
}

export default App;
